import React from 'react';
import './App.css';
import axios from 'axios';
import { Link } from 'react-router-dom';
import { IconButton } from '@material-ui/core';
import ArchiveIcon from '@material-ui/icons/Archive';
import WarningIcon from '@material-ui/icons/Warning';
import DeleteIcon from '@material-ui/icons/Delete';
import MarkunreadIcon from '@material-ui/icons/Markunread';
import SnoozeIcon from '@material-ui/icons/Snooze';
import MoveToInboxIcon from '@material-ui/icons/MoveToInbox';
import LabelIcon from '@material-ui/icons/Label';
import MoreVertIcon from '@material-ui/icons/MoreVert';

class NavBar extends React.Component {
    constructor(props) {
        super(props)
        const dt = new Date()
        this.state = {
            start: dt,
            lastClickTime: dt
        }
    }

    logClick = (e) => {
        const dt = new Date()
        axios({
            method: 'post',
            url: 'http://localhost:8080/logging',
            data: {
                id: e.currentTarget.id,
                time: (dt - this.state.start) / 1000
            }
        })

    }

    render() {
        return (
            <div>
                <IconButton id="archive" aria-label="archive" onClick={this.logClick}><Link to="/page"><ArchiveIcon/></Link></IconButton>
                <IconButton id="warning" aria-label="Warning" onClick={this.logClick}><WarningIcon/></IconButton>
                <IconButton id="delete" aria-label="Delete" onClick={this.logClick}><DeleteIcon/></IconButton>
                <IconButton id="unread" aria-label="Unread" onClick={this.logClick}><MarkunreadIcon/></IconButton>
                <IconButton id="snooze" aria-label="Snooze" onClick={this.logClick}><SnoozeIcon/></IconButton>
                <IconButton id="move" aria-label="Move" onClick={this.logClick}><MoveToInboxIcon/></IconButton>
                <IconButton id="label" aria-label="Label" onClick={this.logClick}><LabelIcon/></IconButton>
                <IconButton id="more" aria-label="More" onClick={this.logClick}><MoreVertIcon/></IconButton>
            </div>
        );
    }
}

export default NavBar;
